import React from 'react'
import News from './compo'

function Test() {
  return (
    <div>
      {news.map((item, index) =>
      {
        return(
            <div className="content" key={index}>
                <p>{item.p}</p>
               
            </div>
        )
      })}
    </div>
  )
}

export default Test
